import SwiftUI

struct MatchDetailsView: View {
  //  var viewModel: MatchCardViewViewModel
    var participant: ParticipantDto?
    var myTeamParticipants: [ParticipantDto] = []
    var opponentParticipants: [ParticipantDto] = []
    let puuid: String
    let match: MatchDto
    init(puuid: String, match: MatchDto) {
        self.puuid = puuid
        self.match = match
        self.participant = match.info.participants.first(where: { $0.puuid == puuid })!
        self.myTeamParticipants = match.info.participants.filter({$0.teamId == participant?.teamId && $0.puuid != puuid})
        self.opponentParticipants = match.info.participants.filter({$0.teamId != participant?.teamId && $0.puuid != puuid})
     }

    
    var body: some View {
       
        NavigationStack {
            if let _ = participant {
                HStack(alignment: .top) {
                    Text("My Team")
                        .bold()
                    Text("76/52/198")
                    Image("score")
                    Text("51/76/117")
                    Text("Opponent")
                        .bold()
                }
                List {
         //           VStack {
        
                        ZStack {
                            if let splashId = ChampionModel.shared.getChampionFromId(id: String(participant?.championId ?? 12))?.id {
                                ChampionSplashView(championId: splashId)
                                    .mask(LinearGradient(gradient: Gradient(stops: [
                                                                       .init(color: .black, location: 0),
                                                                       .init(color: .clear, location: 1),
                                                                       .init(color: .black, location: 1),
                                                                       .init(color: .clear, location: 1)
                                                                   ]), startPoint: .top, endPoint: .bottom))
                            }
                         
                        
                            HStack {
                                Text("ARAM")
                                    .padding(.leading, 40)
                                    .bold()
                                Spacer()
                                ZStack {
                                    RoundedRectangle(cornerRadius: 50)
                                        .foregroundColor(.blue)
                                        .frame(width: 100, height: 40)
                                        .padding()
                                    Text("Victory")
                                        .bold()
                                }
                            }
                            .offset(y:60)
                        }
                        .listRowInsets(EdgeInsets())
                        HStack {
                            Text("My Team")
                                .bold()
                                .padding()
                            Spacer()
                            Image("score")
                                .offset(y:6)
                            Image("minion")
                                .offset(y:6)
                            Image("items")
                                .offset(y:6)
                        }
                        .frame(height: 30)
                    MatchDetailsCellView(participant: participant!)
                    ForEach(myTeamParticipants, id: \.participantId) { (participant: ParticipantDto) in
                        if let champion = ChampionModel.shared.getChampionFromId(id: String(participant.championId)) {
                            NavigationLink(destination: ChampionView(champion: champion)) {
                                MatchDetailsCellView(participant: participant)
                            }
                            .buttonStyle(PlainButtonStyle())
                        }
                        
                    }
                    HStack {
                        Text("Opponent")
                            .bold()
                            .padding()
                        Spacer()
                        Image("score")
                            .offset(y:6)
                        Image("minion")
                            .offset(y:6)
                        Image("items")
                            .offset(y:6)
                    }
                    .frame(height: 30)
                    ForEach(opponentParticipants, id: \.participantId) { (participant: ParticipantDto) in
                        if let champion = ChampionModel.shared.getChampionFromId(id: String(participant.championId)) {
                            NavigationLink(destination: ChampionView(champion: champion)) {
                                MatchDetailsCellView(participant: participant)
                            }
                            .buttonStyle(PlainButtonStyle())
                        }
                           //MatchDetailsCellView(participant: participant)
                    }
                   
                        
             //       }
                   
                }
                .listStyle(.plain)
                .navigationTitle("Match Details")
                .navigationBarTitleDisplayMode(.inline)
            } else {
                EmptyView()
            }
        }
       
 
   
        
    }
}

